import React from 'react';
import photo from '../../assets/images/1.PNG';
import './Project1.css';

function Project1() {
    return (
        <div className="project1-container">
            <h3 style={{marginTop: '0'}}>PROJECTS</h3>
            <div>
                <img src={photo} style={{width: '500px', height: '500px'}} />
            </div>
            <div></div>
            <div></div>
        </div>
    );
};

export default Project1;
